import React, { useState } from "react";
import PokeCard from "./PokeCard";

function App() {
  let arr = [];
  for (let i = 0; i < 6; i++) {
    arr.push(Math.floor(Math.random() * 20));
  }
  // img={`https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/${arr}.png`}/
  <PokeCard />;
}

export default App;
